INSERT INTO `text_translation` VALUES (1,1,'Econom tariff \"Bronze\". You get a file storage with a size 150Mb for only 0.99$ per month.'),(1,2,'Економ тариф \"Bronze\". Лише за 0.99$ в місяць ви отримаєте файлове сховище розміром 150Mb.'),(1,3,'Економ тариф \"Bronze\". Всего за 0.99$ в месяц вы получаете файловое хранилище размером 150Mb.'),(7,1,'Tariff plan \"Silver\" allows you to get 500Mb for placing the required documents, images or other files for only 1.99$ per month.'),(7,2,'Тарифний план \"Silver\" дозволяє вам отримати 500Mb на розміщення необхідних документів, зображень чи інших файлів усього за 1.99$.'),(7,3,'Тарифный план \"Silver\" позволяет вам получить 500Mb для розмещения необходимых документов, изображений или других файлов всего за 1.99$.'),(8,1,'Tariff \"Gold\" gives you file space with 2Gb memory for only $ 4.99 per month.'),(8,2,'Тариф \"Gold\" надає вам 2Gb файлового простору для власного користування за ціною 4.99$ за місяць.'),(8,3,'Тариф \"Gold\" предостовляет вам 2Gb файлового простанства по цене всего 4.99$ в месяц.'),(9,1,'Four tariff'),(9,2,'Четвертий тариф'),(9,3,'Четвертый тариф'),(10,1,'Corporate tariff gives you 50Gb storage memory for your files and a detail\'s support. Also you can use our API file hosting service that provides all the features that you need for your enterprise solutions.'),(10,2,'Корпоративний тарифний план надає вам 50Gb для зберігання ваших файлів, підвищенну підтримку. Також при даному тарифі ви можете використовувати API нашого файлового хостингу, що забезпечує усі необхідні функції для ваших корпоративних рішень.'),(10,3,'Корпоративный тарифный план предоставляет вам 50Gb для сохранения ваших файлов, улучшеную поддержку. Также при данном тарифе вы можете использовать API нашего файлового хостинга, что обеспечивает все необходимые функции для ваших корпоративных решений.'),(11,1,'The base tariff is free for you. He allows you to store files with total size 10Mb.'),(11,2,'Базовий безкоштовний тариф. Дозволяє зберігати вам файли загальним розміром 10Mb.'),(11,3,'Базовый бесплатный тариф. Позволяет сохранять вам файлы сумарным размером 10Mb.');
